  // => public methods ========================
  // ==========================================

  Season.prototype = {

    start: function() {
      try {
        console.log("available themes => " + Object.keys(this._themes));
        this._themes.hasOwnProperty(this._params.theme)

        document.body.classList.add(this._params.theme);  
        var seasonContainer = document.createElement("div");
        seasonContainer.id = this._params.element;  
        seasonContainer.innerHTML = this._themes[this._params.theme].template;
        document.body.appendChild(seasonContainer);

        this._styles();
        this._scripts();        
      } catch(e) {
        console.log(e);
      }
    },

    stop: function() {
      try {
        var seasonContainer = document.getElementById(this._params.element);
        document.body.removeChild(seasonContainer);
      } catch(e) {
        console.log(e);
      }
    }

  };

